import EventEmitter from 'eventemitter3';

export enum EventAction {
  FREQUENCIES_DRAW = 'frequencies_draw',
  ANALYSE_DRAW_START = 'analyse_draw_start',
  ANALYSE_DRAW_END = 'analyse_draw_end',
  GET_AUDIO_BUFFERF = 'get_audio_buffer',
  DRAW_ANALYSE = 'draw_analyse',
  SCALER_SEL = 'scaler_sel',
  SCALER_BAK = 'scaler_bak',
  SCALER_RESIZE = 'scaler_resize',
  DISPLAY_CHANGE = 'display_change',
  ZOOM = 'zoom',
}

export enum ShapeAction {
  CHANGED = 'changed',
  SELECTED = 'selected',
  REMOVE = 'remove',
}

export default new EventEmitter();
